 may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Notespace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"111\" [:div nil [:div [:p/markdown \"### void\\n\\nA `:void` note does not render its value.\"]]], \"119\" [:div nil [:div [:p/markdown \"* a\\n* b\\n* c\\n* d\"]]], \"15\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"42\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"7\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"128\" [:div [:p/code {:code \"^k/hiccup\\n[:p/leafletmap\\n    {:tile-layer leaflet-providers/Stamen-TonerLite} at says it is still pending.\"]]], \"99\" [:div nil [:div [:p/markdown \"If a note's value is an atom, then Notespace will be informed when its value changes. This allows Notespace to update its state with the dereferenced value.\\n\\nFor example:\"]]], \"130\" [:div nil [:div [:p/markdown \"Some additional tags such as `:p/code` are added by the [gorilla-notes](https://github.com/scicloj/gorilla-notes) infrastructure.\"]]], \"38\" [:div [:p/code {:code \"^k/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"122\" [:div nil [:div [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]]], \"120\" [:div nil [:div [:p/markdown \"### hiccup\\n\\nA `:hiccup` note renders its value as Hiccup.\"]]], \"70\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"144\" [:div [:p/code {:code \"(future\\n  (Thread/sleep 2000)\\n  (->> #(- (rand) 0.5)\\n       (repeatedly 9)\\n       (reductions +)))\", :bg-class \"bg-light\"}] [:div [:div [:p \"(@)\"] [:p/code {:code \"(0.10463321598622122\\n 0.2610841920213466\\n -0.19555534475185576\\n -0.43058244956126557\\n -0.24916473546389784\\n 0.08143059156165777\\n -0.298212460563429\\n 0.13401576056682518\\n 0.020338473543036972)\\n\"}]]]], \"134\" [:div [:p/code {:code \"^k/dataset-grid\\n{:x (range 9)\\n :y (repeatedly 9 rand)\\n :z (take 9 (cycle \\\"abc\\\"))}\", :bg-class \"bg-light\"}] [:div [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p \"(showing first 100 rows)\"] [:p/dataset {:columnDefs [{:headerName \"x\", :field \"x\"} {:headerName \"y\", :field \"y\"} {:headerName \"z\", :field \"z\"}], :rowData ({\"x\" 0, \"y\" 0.6515275512921201, \"z\" \\a} {\"x\" 1, \"y\" 0.6186962184920681, \"z\" \\b} {\"x\" 2, \"y\" 0.4705467433727636, \"z\" \\c} {\"x\" 3, \"y\" 0.34143477930687793, \"z\" \\a} {\"x\" 4, \"y\" 0.4160657494126587, \"z\" \\b} {\"x\" 5, \"y\" 0.9467331350722854, \"z\" \\c} {\"x\" 6, \"y\" 0.3026430585936484, \"z\" \\a} {\"x\" 7, \"y\" 0.09071106492864223, \"z\" \\b} {\"x\" 8, \"y\" 0.5117096928035066, \"z\" \\c})}]]]], \"77\" [:div nil [:div [:p/markdown \"Notespace renders it so that we see both the code and the evaluation result.\\n\\nAll your namespace is seen as a sequence of toplevel forms, which are considered as notes, and rendered accordingly.\"]]], \"39\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"63\" [:div [:p/code {:code \"^k/dataset-grid\\n{:x (range 9)\\n :y (repeatedly 9 rand)\\n :z (take 9 (cycle \\\"abc\\\"))}\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"84\" [:div [:p/code {:code \"d1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"43\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"125\" [:div [:p/code {:code \"^k/hiccup\\n[:div\\n [:h5 \\\"Plot:\\\"]\\n [:p/sparklinespot\\n  {:data      (->> #(- (rand) 0.5)\\n                   (repeatedly 99)\\n                   (reductions +))\\n   :svgHeight 20}]]\", :bg-class \"bg-light\"}] [:div [:div [:h5 \"Plot:\"] [:p/sparklinespot {:data (0.42613588334471386 0.8084024659158924 1.1385651148709992 0.8867347615481843 1.294806197599871 1.2194107769924418 1.5761453661987561 1.149978904449417 1.0654785154265185 1.5348281186303694 1.0426744150532756 0.9748333125343944 0.9999802729682993 1.1900537284113772 1.5926448021199833 1.1674784732576158 1.64739421950269 1.5920100410794837 2.0739880554294134 1.7782283201583615 1.6185920323914011 1.525030015863516 1.5292478354442043 1.8764874656970845 1.9329872251658322 2.270417663304534 2.2846510305145697 2.323349106011239 1.827830530214883 2.1521785965602973 2.5334766956767725 2.5986305268286922 2.394126391468471 2.778181675324038 2.992706598344665 2.6728594363680944 2.755910486195067 3.0879308908942193 2.925929610129627 2.696095666729399 2.86619494533961 2.5702019653435983 2 s still a bit buggy around handling concurrency, updating efficiently and connecting to the browser. But the current version should be enough to start a community discussion around where we should be taking this.\"]]], \"37\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"142\" [:div nil [:div [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]]], \"46\" [:div [:p/code {:code \"^k/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"127\" [:div [:p/code {:code \"(require '[gorilla-notes.components.leaflet.providers :as leaflet-providers])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"11\" [:div [:p/code {:code \"(def d2 (delay 12))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"109\" [:div [:p/code {:code \"^k/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"((3 0 2 2 5 1)\\n (3 5 5 2 3 4)\\n (4 4 0 4 3 2)\\n (1 2 2 2 2 1)\\n (3 1 1 2 0 5)\\n (1 4 2 1 3 3))\\n\"}]]], \"124\" [:div nil [:div [:p/markdown \"### extended hiccup\\n\\nIn fact, `:hiccup` and `:hiccup-nocode` render by an extended version of Hiccup, that supports [gorilla-ui](https://github.com/pink-gorilla/gorilla-ui) tags.\\n\\nHere are some examples.\"]]], \"138\" [:div nil [:div [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]]], \"45\" [:div [:p/code {:code \"^k/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"114\" [:div nil [:div nil]], \"56\" [:div [:p/code {:code \"(require '[gorilla-notes.components.leaflet.providers :as leaflet-providers])\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"32\" [:div [:p/code {:code \"^k/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"133\" [:div nil [:div [:p/markdown \"### dataset-grid\\n\\nNotes of kind `:dataset-grid` are expecting a value that is a map, whose values are same-length sequentials. One example of such a map is a dataset of the [tech.ml.dataset](github.com/techascent/tech.ml.dataset) and [Tablecloth](https://github.com/scicloj/tablecloth) libraries.\\n\\nFor example:\"]]], \"55\" [:div [:p/code {:code \"^k/hiccup\\n(into [:ul]\\n      (for [i (range 9)]\\n        [:li\\n         i \\\" \\\"\\n         [:p/sparklinespot\\n          {:data      (for [j (range 999)]\\n                        (+ (* 0.2 (rand))\\n                           (Math/sin (* i j))))\\n           :limit     100\\n           :svgWidth  100\\n           :svgHeight 20}]]))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"85\" [:div [:p/code {:code \"d2\", :bg-class \"bg-light\"}] [:div [:div [:p \"(@)\"] [:p/code {:code \"12\\n\"}]]]], \"126\" [:div [:p/code {:code \"^k/hiccup\\n(into [:ul]\\n      (for [i (range 9)]\\n        [:li\\n         i \\\" \\\"\\n         [:p/sparklinespot\\n          {:data      (for [j (range 999)]\\n                        (+ (* 0.2 (rand))\\n                           (Math/sin (* i j))))\\n           :limit     100\\n           :svgWidth  100\\n           :svgHeight 20}]]))\", :bg-class \"bg-light\"}] [:div [:ul [:li 0 \" \" [:p/sparklinespot {:data (0.07362335351802281 0.17255215350659958 0.09901181905507561 0.1922565778446711 0.0987767612261818 0.14859334007329503 0.15502589967472521 0.14845998871993596 0.17924033684980564 0.17920836360331485 0.0695651321999794 1.227116338550216E-4 0.07143776669960382 0.023084692219910122 0.1650493885113199 0.09649066298425953 0.16395316371714552 0.189773013905791
